import React from 'react';
// import RestaurantItem from './restaurant-item';

class RestaurantContainer extends React.Component {
    constructor(props) {
        super(props);
        // this.handleFilterCity = this.handleFilterCity.bind(this);
        this.state = {
            restaurants: [],
            city: ''
        }
    }

    componentDidMount() {
        const KEY = "MDpiNmM2NjY3ZS0yYTU3LTExZTgtOWE2Ny1jYjk2YzY5Mjc3Y2M6ckxlUWhDdG1tZzVXOEM0YXRreWxJV1BEZ3RhaTJCVWFLUEg3";
        fetch(`https://lcboapi.com/products?access_key=${KEY}&q=beaus&where=is_seasonal&per_page=30`)
            .then(res => res.json())
            .then(
                (result) => {
                    this.setState({ beers: result.result })
                }
            )
    }

    render() {
        const restaurantsList = [];

        this.state.restaurants.forEach(restaurant => {
            restaurantsList.push(
                // <restaurantsItem />
                <li>{this.name}</li>
            )
        })

        return (
            <div className="">
                <ul>{restaurantsList}</ul>
            </div>
        )
    }
}

export default RestaurantContainer;
